import { useEffect, useState } from "react";
import { fetchBooks } from "../../api/FakeBookApi";

const BookList = () => {
  const [books, setBooks] = useState(null);
  useEffect(() => {
    const getAllBooks = async () => {
      const result = await fetchBooks();
      setBooks(result);
    };
    getAllBooks();
  }, []);

  console.log(books);

  return (
    <div className="list">
      {books.map((el) => {
        <Book />;
      })}
    </div>
  );
};

export default BookList;
